### Summary of Core Topics, Concepts, Principles, and Equations

#### Core Topics and Concepts

1. **Multi-Armed Bandits**
   - **Epsilon-Greedy Policy**: A policy that balances exploration and exploitation by choosing a random action with probability epsilon and the best-known action with probability 1-epsilon.
   - **Reward Distribution**: Understanding the distribution of rewards for different arms.
   - **Optimal Arm**: The arm with the highest expected reward.

2. **Markov Decision Processes (MDPs)**
   - **States and Actions**: Defining the set of states (S) and actions (A).
   - **Transition Probabilities**: Probability of moving from one state to another given an action, denoted as \( p(s'|s, a) \).
   - **Rewards**: Immediate rewards for taking an action in a state, denoted as \( r(s, a) \).
   - **Discount Factor (γ)**: A factor that determines the importance of future rewards.

3. **Value Iteration**
   - **Value Function**: The expected return starting from a state, denoted as \( v(s) \).
   - **Bellman Equation**: The equation used to update the value function.
   - **Policy**: A strategy that defines the action to take in a given state.

4. **Grid World Problems**
   - **States and Actions**: Defining the grid world and possible actions.
   - **Optimal Policy and Value Functions**: Calculating the optimal policy and corresponding state and action value functions.

#### Important Equations

1. **Epsilon-Greedy Policy**
   \[
   \pi(a|s) =
   \begin{cases}
   \epsilon / |A(s)| & \text{if } a \text{ is exploratory} \\
   1 - \epsilon + \epsilon / |A(s)| & \text{if } a \text{ is greedy}
   \end{cases}
   \]

2. **Bellman Equation for Value Function**
   \[
   v_{\pi}(s) = \sum_a \pi(a|s) \sum_{s'} \sum_r p(s', r|s, a) [r + \gamma v_{\pi}(s')]
   \]

3. **Value Iteration Update Rule**
   \[
   v(s) = \max_a \left[ r(s, a) + \gamma \sum_{s'} p(s'|s, a) v(s') \right]
   \]

4. **Expected Return (G)**
   \[
   G_t = R_{t+1} + \gamma R_{t+2} + \gamma^2 R_{t+3} + \cdots = \sum_{k=0}^{\infty} \gamma^k R_{t+k+1}
   \]

5. **Action Value Function (Q)**
   \[
   q_{\pi}(s, a) = \sum_{s'} p(s'|s, a) [r(s, a) + \gamma v_{\pi}(s')]
   \]

